package com.example.weather.repository;import lombok.Getter;import lombok.Setter;import javax.persistence.Column;import javax.persistence.Entity;import javax.persistence.Table;@Entity@Table(name = "weather")@Getter@Setterpublic class WeatherEntity extends BaseEntity {    @Column(name = "weather_ref_Id")    public void setRefId(Long refId) {        super.setRefId(refId);    }    @Column(name = "weather_response_id")    private int weatherResponseId;    @Column    private String main;    @Column    private String description;    @Column    private String icon;}